import React, {Component, Fragment} from 'react';
import {Route, Switch} from "react-router-dom";
import AboutPage from "../pages/AboutPage";
import HomePage from "../pages/HomePage";
import ServicePage from "../pages/ServicePage";
import CoursesPage from "../pages/CoursesPage";
import PortfolioPage from "../pages/PortfolioPage";
import ContactPage from "../pages/ContactPage";

class AppRoute extends Component {
    render() {
        return (
            <Fragment>


                <Switch>
                    <Route exact="/" component={HomePage}/>
                    <Route exact="/service" component={ServicePage}/>
                    <Route exact="/course" component={CoursesPage}/>
                    <Route exact="/portfolio" component={PortfolioPage}/>
                    <Route exact="/contact" component={ContactPage}/>
                    <Route exact="/about" component={AboutPage}/>


                </Switch>


            </Fragment>
        );

    }
}

export default AppRoute;
